def factorize(n: int) -> List[int]:
    factors = []
    divisor = 2
    while n >= divisor ** 2:
        if n % divisor == 0:
            factors.append(divisor)
            n //= divisor
        else:
            divisor += 1
    factors.append(n)
    return factors

